import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';

import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { useNavigate } from 'react-router-dom';
import './header.css';
export function Header() {
  let navigate=useNavigate();
  const handleClick = () => {
    navigate('/login')
  }
  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container fluid>
        <Navbar.Brand href="#" className="header-heading">BetterUp</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            navbarScroll
          >
            <Nav.Link href="#action1" className='action'>About</Nav.Link>
            <Nav.Link href="#action2" className='action'>Contact</Nav.Link>
            <NavDropdown  className='action'title="Coaching" id="navbarScrollingDropdown">
              <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
              <NavDropdown.Item href="#action4">
                Another action
              </NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action5">
                Something else here
              </NavDropdown.Item>
            </NavDropdown>
          </Nav>
          <Button variant="outline-success" className='login-btn' onClick={handleClick} >Login</Button>
          <Button variant="outline-danger" className='coach-btn'>Find your coach</Button>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}
